            <svg class="hn-content-body__img" width="51" height="75" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M24.74 27.155l2.249-18.349 2.384-4.377c-.87-.975-.54-2.318.469-2.705.946-.364 8.6.42 9.547.518.946.097 8.599.9 9.453 1.45.91.586.963 1.968-.085 2.745l1.454 4.774-4.49 44.194-2.254 3.1s-4.453.046-9.648-.488l-.096-.01-.096-.01a92.393 92.393 0 01-4.186-.538" stroke="#fff" stroke-width="1.5" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"/><path d="M29.422 4.425c4.136.23 10.167.85 10.167.85l-.958-.1s6.03.62 10.127 1.235M26.989 9.29l12.06 1.238-.957-.098 12.062 1.237M45.667 55.406c-6.156-.342-10.474-.685-11.527-.793-.658-.068-2.19-.218-5.086-.616" stroke="#fff" stroke-width="1.5" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"/><path d="M37.929 16.649l-2.823 6.474-6.935-.72 5.19 4.72-2.823 6.473 6.031-3.556 5.191 4.72-1.464-6.919 6.031-3.555-6.935-.72-1.463-6.917z" fill="#fff"/><path d="M2.388 22.511c-1.086-.724-1.1-2.107-.218-2.737.826-.592 8.437-1.771 9.378-1.916.941-.146 8.555-1.307 9.519-.991 1.027.337 1.423 1.661.6 2.679l2.597 4.252 6.643 43.908-1.413 3.57s-4.303 1.173-9.468 1.972l-.095.015-.096.015c-5.167.79-9.62.964-9.62.964L7.81 71.259 1.167 27.35l1.221-4.839z" stroke="#fff" stroke-width="1.5" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"/><path d="M2.386 22.476c4.061-.816 10.054-1.731 10.054-1.731l-.951.145s5.993-.915 10.113-1.348M1.25 27.79l11.986-1.828-.95.145L24.27 24.28M7.881 71.26c6.132-.645 10.618-1.229 11.665-1.389 1.046-.16 5.312-.913 11.356-2.128" stroke="#fff" stroke-width="1.5" stroke-miterlimit="10" stroke-linecap="round" stroke-linejoin="round"/><path d="M13.71 32.173l-1.126 6.98-6.895 1.06 6.2 3.252-1.126 6.978 4.957-4.969 6.2 3.252-3.137-6.323 4.957-4.968-6.895 1.061-3.136-6.323z" fill="#fff"/></svg>
