Xr8wall.prototype.postInitialize = function () {
    console.log("[xr8wall]", "post init", this.ready)
    if (this.ready) {
        window.tools.delay(12.0, () => {
            XR8.removeCameraPipelineModule(XRExtras.Loading.pipelineModule());
            var lc = document.getElementById('loadingContainer');
            lc.style.visibility = 'hidden';
            this.app.fire('xr8wall:ready');
        }, this);
    }
}

Xr8wall.prototype.process_camera = function (camerapixelarray) {
    const { rows, cols, rowBytes, pixels } = camerapixelarray
    if (this.captureCallback) {
        if (!this.texture || this.texture.width != camerapixelarray.cols || this.texture.height != camerapixelarray.rows) {
            this.texture = new pc.Texture(this.app.graphicsDevice, {
                width: camerapixelarray.cols,
                height: camerapixelarray.rows,
                format: pc.PIXELFORMAT_R8_G8_B8_A8
            });
            if (!this.log) {
                console.log(camerapixelarray);
                this.log = true;
            }
        }

        let p = this.texture.lock();
        p.set(camerapixelarray.pixels);
        this.texture.unlock();
        if (this.cameraStream) {
            this.cameraStream.element.texture = this.texture;
        }
        if (this.captureCallback) {
            this.captureCallback = null;
            this.captureCallback(this.texture);
        }
    }
};